INSERT INTO `incentives` (`id`, `title`, `description`, `start_date`, `end_date`, `interest_rate_first_year`, `status`, `incentive_banner`, `builder_id`, `created_at`, `updated_at`) VALUES
('9d2ad55f-982b-43dc-a1bb-f32456ac7e6d', 'Inventory Home Incentive', '<p><span style=\"color: rgb(41, 80, 59);\">Get up to $5,000 towards closing costs &amp; up to $1% of your loan amount (up to $5,000) towards interest rate buy down when you use a preferred vendor on an Inventory Home!</span></p>', '2054-10-01', '2075-11-14', 20.00, 1, 539, '9d408aa7-ba82-42a3-b0a7-6dda8017e87a', '2024-10-04 15:15:39', '2025-03-24 17:06:31'),
('9d2ad560-c7f4-4e8f-b0b8-79caa3fab0d0', 'Luxury Living at The Strip', '<blockquote><span class=\"hljs-string\">Experience unparalleled luxury with our latest homes located on The Strip. Enjoy world-class amenities and breathtaking views.</span></blockquote>', '2027-10-13', '2067-11-18', 25.00, 1, 182, '9d09a7ab-a328-473b-9d44-b3637e545501', '2024-10-04 15:15:40', '2025-03-24 17:06:20'),
('9d2ad561-ce01-474a-adb9-a5b196d74c53', 'Pre-Sale Incentive', '<p>Get up to $5,000 in design center upgrade credit &amp; 1% of your loan amount (up to $5,000) credited toward rate buy down when you use a preferred vendor on a pre-sale lot!</p>', '2072-10-06', '2060-11-10', 50.00, 1, 538, '9d09a566-6d4c-4dec-bbf1-75df4305c8e1', '2024-10-04 15:15:41', '2025-03-24 17:06:08'),
('9d2ad562-e4dc-47c1-bb00-b32ae2ff7089', 'Family-Friendly Community Special', '<p>Join our family-friendly community in Las Vegas with great schools, parks, and recreational activities. Limited-time incentives available!</p>', '2028-10-19', '2057-06-08', 25.20, 1, 1, '9d09a7ab-a328-473b-9d44-b3637e545501', '2024-10-04 15:15:42', '2025-03-24 17:05:52');
